import React from 'react';
import "./home.css";
import Me from "../../assets/avatar-1.svg"

const Home = () => {
  return (
    <section className="home container" id="home">
      <div className="intro">
        <img src={Me} alt="" className="home__img" />
      </div>
    </section>
  )
}

export default Home
